query blogPostQuery(
  $slug: String!
) {
  contentfulBlogPost(slug: {eq: $slug}) {
    id
    slug
    title
    subtitle
    published
    heroImage {
      id
      title
      description
      file {
        url
      }
    }
    bodyContent {
      bodyContent
    }
    author {
      id
      name
      email
      birthday
      biography {
        biography
      }
    }
  }
}

query BlogPageQuery {
  allContentfulBlogPost {
    edges {
      node {
        id
        title
        slug
        subtitle
        published
        bodyContent {
          bodyContent
        }
        heroImage {
          title
          description
          file {
            url
            fileName
            contentType
          }
        }
        author {
          id
          name
          email
          birthday
          biography {
            biography
          }
        }
      }
    }
  }
}
